65_landet_1627\u003cbr\u003etype: usage\u003c/p\u003e", "x": 90.6410297033112, "y": 238.30826284182865}, {"color": "#377eb8", "id": "1970-2015_landet_4322", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEtter forskrifter fastsatt ved kongelig resolusjon den 24. juni\u003cbr\u003e1983 med hjemmel i folketrygdloven \u00a7 4-3 nr. 4 bokstav b kan inntekt\u003cbr\u003eopptjent p\u00e5 et utenlandsregistrert skip likestilles med inntekt av\u003cbr\u003earbeid her i \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_4322\u003cbr\u003etype: usage\u003c/p\u003e", "x": -14.66254992781059, "y": 336.5723906531456}, {"color": "#377eb8", "id": "1929-1965_landet_716", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eTyskerne brukte ham bevisst som skremsel fordi alle var redd\u003cbr\u003eham her i \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_716\u003cbr\u003etype: usage\u003c/p\u003e", "x": -256.6109257744814, "y": 294.58149860507245}, {"color": "#377eb8", "id": "1970-2015_landet_2542", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDomstolen skal ta anmodningen til f\u00f8lge og fremme bevisopptaket\u003cbr\u003eunder anvendelse av de samme tvangsmidler og samme framgangsm\u00e5te som\u003cbr\u003eanvendes n\u00e5r anmodningen utg\u00e5r fra kompetent myndighet her i\u003cbr\u003e\u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_2542\u003cbr\u003etype: usage\u003c/p\u003e", "x": -77.16432592731692, "y": 144.47311533444523}, {"color": "#377eb8", "id": "1970-2015_landet_8036", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBoligmassen var fordelt over hele \u003cb\u003elandet\u003c/b\u003e.\u003cbr\u003eAdministrasjonen var plassert i Oslo.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_8036\u003cbr\u003etype: usage\u003c/p\u003e", "x": -360.3718885703515, "y": -41.93763804832598}, {"color": "#377eb8", "id": "1970-2015_landet_6537", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet nasjonale skredatlaset vil gi kommuner,\u003cbr\u003eberedskapsmyndigheter og andre bedre kunnskap om skredrisiko i ulike\u003cbr\u003edeler av \u003cb\u003elandet\u003c/b\u003e. Styret for Statens naturskadefond under\u003cbr\u003eLandbruksdepartementet har tatt initiativ til \u00e5 kartlegge\u003cbr\u003eansvarsforholdene med videre for sikringstiltak mot naturskader.\u003cbr\u003eOppdraget vil omfatte en utredning om risikoanalyse som grunnlag for\u003cbr\u003ekunnskapsbaserte politiske prioriteringer av blant annet\u003cbr\u003esikringstiltak mot naturskader, en kartlegging av hvilke institusjoner\u003cbr\u003esom i dag har ansvar for sikring mot naturskader, og identifisering av\u003cbr\u003eeventuelle gr\u00e5soner og uavklarte ansvarsforhold p\u00e5\u003cbr\u003esikringsomr\u00e5det.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_6537\u003cbr\u003etype: usage\u003c/p\u003e", "x": 26.170036872154892, "y": -73.45685898329795}, {"color": "#377eb8", "id": "1929-1965_landet_257", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSom medlem av Riksr\u00e5det treffes han f\u00f8rste gang utover h\u00f8sten\u003cbr\u003e1524 i Bergen, hvor Riksr\u00e5det med erkebisp Olav i spissen p\u00e5 Norges\u003cbr\u003evegne opsier Christian II troskap og meddeler nam at man vil velge en\u003cbr\u003eannen konge som bedre kan regjere og forsvare \u003cb\u003elandet\u003c/b\u003e. K. deltar\u003cbr\u003ei en rekke betydningsfulle m\u00f8ter i denne for Norge vanskelige tiden,\u003cbr\u003eer 23 /8 med p\u00e5 det enstemmige valget av Frederik, Danmarks konge, til\u003cbr\u003enorsk konge under forutsetning av at han undertegner den av r\u00e5det\u003cbr\u003eutarbeidede saerlige h\u00e5ndfestning for Norge. \u2014 Mere i forgrunnen trer\u003cbr\u003eK. under det motsetningsforhold han er kommet i til VincenB Lunge, som\u003cbr\u003ep\u00e5 forskjellig vis legger sig efter K., s\u00f8ker \u00e5 frata nam hans\u003cbr\u003eforlening i Sogn hvor Vincens Lunge selv hadde len, jager K. og hans\u003cbr\u003efamilie fra g\u00e5rden og endog pr\u00f8ver \u00e5 f\u00e5 sl\u00e5tt ham ihjel\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_257\u003cbr\u003etype: usage\u003c/p\u003e", "x": -79.62126652520591, "y": -150.93186627348723}, {"color": "#377eb8", "id": "1929-1965_landet_1192", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e5r de s\u00e5 endelig n\u00e5dde fram i en mer eller mindre forkommen\u003cbr\u003etilstand, fikk de tildelt land av myndighetene, uten at det var\u003cbr\u003eunders\u00f8kt om det egnet seg for \u00e5kerbruk; det gjaldt bare f\u00f8rst og\u003cbr\u003efremst \u00e5 f\u00e5 dem spredt langs grensen i passende avstand, for at de\u003cbr\u003ekunne befordre post og skyss og danne et slags bevepnet vern for\u003cbr\u003e\u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_1192\u003cbr\u003etype: usage\u003c/p\u003e", "x": -339.69599685134756, "y": 189.25540028340535}, {"color": "#377eb8", "id": "1929-1965_landet_2242", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eMed tilvising til dette meiner komiteen at det er lite\u003cbr\u003erealistisk \u00e5 ta opp framlegg om \u00e5 byggje ut nye gymnas som\u003cbr\u003estatsinstitusjonar. Komiteen ser det ogs\u00e5 slik at det er lite\u003cbr\u003erasjonelt at staten skal eige og halde ved like ei rekkje med\u003cbr\u003ebygningar for statsskolar utover \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_2242\u003cbr\u003etype: usage\u003c/p\u003e", "x": -450.58662037672144, "y": 54.46339033103953}, {"color": "#377eb8", "id": "1929-1965_landet_973", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet er i denne forbindelse saerlig fremhevet at de lovbefalte\u003cbr\u003eoppgaver \u2014 det vil si oppgaver som er p\u00e5lagt kommunene av staten med\u003cbr\u003eeller uten tilskudd fra denne \u2014 etter hvert har erobret en st\u00f8rre og\u003cbr\u003est\u00f8rre del av budsjettene og at disse oppgavene i alminnelighet vil\u003cbr\u003evaere tyngende fordi det som regel kreves at de skal l\u00f8ses noenlunde\u003cbr\u003elikeartet over hel\u003cb\u003ee land\u003c/b\u003eet. Med den sterke vekst av de\u003cbr\u003ekommunale oppgaver er det etterh\u00e5nden blitt noks\u00e5 mange kommuner som\u003cbr\u003eikke makter \u00e5 balansere sine budsjetter ved egen hjel\u003cspan style=\"color:#808080;\"\u003ep.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_973\u003cbr\u003etype: usage\u003c/p\u003e", "x": 136.38735354515785, "y": -141.27733150126247}, {"color": "#377eb8", "id": "1970-2015_landet_8656", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI Oslofjordomr\u00e5det er det mindre avstand mellom de foresl\u00e5tte\u003cbr\u003esentrale havner enn andre steder i \u003cb\u003elandet\u003c/b\u003e. Styringsgruppen har\u003cbr\u003eimidlertid funnet at det innen planperioden ikke vil vaere realistisk\u003cbr\u003emed en ytterligere havnekonsentrasjon i dette omr\u00e5det da det er l\u00e5st\u003cbr\u003efast store verdier i navnenes eksisterende infrastruktur og\u003cbr\u003evirksomheter\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_8656\u003cbr\u003etype: usage\u003c/p\u003e", "x": -52.21753853458098, "y": -304.22260193426956}, {"color": "#377eb8", "id": "1929-1965_landet_331", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen situasjon som forel\u00e5 ved krigsutbruddet, var da slik at den\u003cbr\u003eetter forutsetningen skulle na betinget full oppsetting av\u003cbr\u003elinjestyrkene, selv om en ikke mente det forel\u00e5 umiddelbar krigsfare\u003cbr\u003efor \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_331\u003cbr\u003etype: usage\u003c/p\u003e", "x": 229.73135067379198, "y": -27.5090962778826}, {"color": "#377eb8", "id": "1970-2015_landet_5655", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\"En rekke ulike atomulykker og ulykker med str\u00e5lekilder har\u003cbr\u003efunnet sted gjennom \u00e5rene. Felles for mange ulykker og uhell er at de\u003cbr\u003eskyldes en kombinasjon av tekniske feil, manglende eller\u003cbr\u003eutilstrekkelige prosedyrer og s\u00e5kalt \"\"menneskelig svikt.\"\" Norge er\u003cbr\u003eomgitt av en rekke ulike kilder som potensielt kan bidra til\u003cbr\u003eradioaktiv forurensning\u003cb\u003e i lan\u003c/b\u003edet. Risikoen for nedfall over\u003cbr\u003enorsk territorium fra ulike kilder i andre land er reell, og\u003cbr\u003elangtidskonsekvensene kan vaere betydelige. Risikoen for ukontrollerte\u003cbr\u003eutslipp til Irskesj\u00f8en, Nordsj\u00f8e\u003cspan style=\"color:#808080;\"\u003en og\"\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_5655\u003cbr\u003etype: usage\u003c/p\u003e", "x": -116.64255916048766, "y": 337.0707514257198}, {"color": "#377eb8", "id": "1970-2015_landet_1490", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI Norden er munken mest vanlig i de s\u00f8rlige og sommervarme\u003cbr\u003eomr\u00e5der. Norsk utbredelse og habitatvalg I Norge er munken knyttet til\u003cbr\u003el\u00f8vskogsrike omr\u00e5der i de s\u00f8rlige og sommervarme deler av\u003cbr\u003e\u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_1490\u003cbr\u003etype: usage\u003c/p\u003e", "x": -202.96786423305696, "y": 43.139037472045324}, {"color": "#ff7f00", "id": "1970-2015_landet_6546", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet vises i denne forbindelse bl. a. til oversikten i vedlegg 1\u003cbr\u003eover lover som har bestemmelser om gj\u00f8rem\u00e5l som lensmennene har i\u003cbr\u003eegenskap av politi p\u00e5 \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1970\u003cbr\u003egrouping: 1970-2015\u003cbr\u003eidentifier: 1970-2015_landet_6546\u003cbr\u003etype: usage\u003c/p\u003e", "x": 724.8361579067566, "y": 56.79139455751901}, {"color": "#ff7f00", "id": "1929-1965_landet_79", "label": "1", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u2014 Det er sant at jeg var i Ukraina i to \u00e5r, men jeg var aldri\u003cbr\u003eute p\u00e5 \u003cb\u003elandet\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_79\u003cbr\u003etype: usage\u003c/p\u003e", "x": 536.586058585993, "y": 467.38377899720496}, {"color": "#4daf4a", "id": "1929-1965_landet_2337", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHan var lys og kr\u00f8llet i h\u00e5ret med kloke \u00f8yne og s\u00e5 vig og\u003cbr\u003esmidig og vakker at alle bygdens piker gjorde seg aerend og sognet til\u003cbr\u003eboden bare for \u00e5 se ham. Og dertil var han s\u00e5 dyktig i all sin\u003cbr\u003egjerning at handelsmannen aldri ville skille seg med ham. S\u00e5 var det\u003cbr\u003eengang han for ut til fiskevaeret for prinsipalen. Str\u00f8mmen bar stri\u003cbr\u003eimot, og han rodde lang\u003cb\u003es land\u003c/b\u003ee\u003cspan style=\"color:#808080;\"\u003et.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_2337\u003cbr\u003etype: usage\u003c/p\u003e", "x": 570.2411168102074, "y": -496.1656977244763}, {"color": "#f781bf", "id": "1929-1965_landet_817", "label": "3", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eVi endret kursen til NNV, og om kvelden til N, det skulle\u003cbr\u003eskjaere inn p\u00e5\u003cb\u003e lande\u003c/b\u003et\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1929\u003cbr\u003egrouping: 1929-1965\u003cbr\u003eidentifier: 1929-1965_landet_817\u003cbr\u003etype: usage\u003c/p\u003e", "x": -83.79068810960305, "y": -750.0}]);
